import emptyCart from './assets/img/cart-trolley-ui-5-svgrepo-com.svg';
const cart = (svg) => {
    return (
    <div>
        <img src={svg} alt="cart" />
    </div>
    )
}
const cartWidget = () => {
    return (
        <div>
            <cart svg="emptyCart"/>
        </div>
    )
}
export default cartWidget;
